import React from "react";
import Contract from "./Contract";
import "./styles/Contracts.css";
import "./styles/GridLayout.css";

const ContractContainer = (props) => (
  <div className="contractContainer">
    <Contract className="col-4" name={props.contracts[0].name} startDate={props.contracts[0].startDate} endDate={props.contracts[0].endDate} startPrice={props.contracts[0].startPrice} description={props.contracts[0].description}/>
    <Contract className="col-4"/>
    <Contract className="col-4"/>
    <Contract className="col-4"/>
    <Contract className="col-4"/>
    <Contract className="col-4"/>
    <Contract className="col-4"/>
    <Contract className="col-4"/>
    <Contract className="col-4"/>
  </div>
);

export default ContractContainer;
